import React from 'react';
import './ProfileButton.css';

function ProfileButton() {
  const handleClick = () => {
    console.log('Profile clicked');
  };

  return (
    <button className="profile-button" onClick={handleClick}>
      <svg className="button-icon" width="20" height="20" viewBox="0 0 20 20" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path d="M10 10C12.7614 10 15 7.76142 15 5C15 2.23858 12.7614 0 10 0C7.23858 0 5 2.23858 5 5C5 7.76142 7.23858 10 10 10Z" fill="white"/>
        <path d="M10 12C5.58172 12 2 14.2386 2 17V20H18V17C18 14.2386 14.4183 12 10 12Z" fill="white"/>
      </svg>
      <span className="button-text">Профиль</span>
    </button>
  );
}

export default ProfileButton;
